// SPDX-License-Identifier: MIT
pragma solidity ^0.6.10;

contract arraySample {

    // Fixed-length array to store 50 age values (0 to 49)
    uint8[50] age;

    // Dynamic array to store phone numbers
    uint[] phoneNumber;

    // Event emitted when a fixed array value is updated
    event AgeUpdated(uint8 index, uint8 value);

    // Event emitted when a new phone number is added
    event PhoneNumberAdded(uint value);

    // Set a value in the fixed array with bounds check
    function setData(uint8 index, uint8 value) public {
        require(index < 50, "Index out of bounds (0-49)");
        age[index] = value;
        emit AgeUpdated(index, value); // Notify frontend/logs
    }

    // Get a value from the fixed array
    function getData(uint8 _index) public view returns (uint8) {
        require(_index < 50, "Index out of bounds (0-49)");
        return age[_index];
    }

    // Push a value to the dynamic array
    function setDynamicArray(uint _phoneno) public {
        phoneNumber.push(_phoneno);
        emit PhoneNumberAdded(_phoneno); // Track addition
    }

    // Get a value from the dynamic array
    function getDynamicArray(uint _index) public view returns (uint) {
        require(_index < phoneNumber.length, "Invalid index");
        return phoneNumber[_index];
    }

    // Get total count of phone numbers stored
    function getPhoneNumberCount() public view returns (uint) {
        return phoneNumber.length;
    }

    // Update a phone number at a given index
    function updatePhoneNumber(uint _index, uint _newNumber) public {
        require(_index < phoneNumber.length, "Index out of range");
        phoneNumber[_index] = _newNumber;
    }

    // Delete a phone number (sets it to 0, does not shrink array)
    function deletePhoneNumber(uint _index) public {
        require(_index < phoneNumber.length, "Invalid index");
        delete phoneNumber[_index]; // sets the value to 0
    }

    // Return all phone numbers (view-only helper)
    function getAllPhoneNumbers() public view returns (uint[] memory) {
        return phoneNumber;
    }
}
